import styled from 'styled-components'

export const SideBarStyle = styled.div`

ul{
    padding: 0;
    margin: 0;
}

li{
    list-style: none;
}

.container{
    position: fixed;
    margin: 0;
    background-color: #1E212A;
    width: 200px;
    height: 100vh;
}

h1 {
    margin: 0;
    color: #ffff;
    font-size: 25px;
    margin-left: 0;
}

span {
    color: #00FF7F;
}

`
